package com.atc.domains.home.entity;import javax.persistence.Entity;import javax.persistence.GeneratedValue;import javax.persistence.Id;import javax.persistence.Table;import java.io.Serializable;/** * Created by Vic.Feng on 30/11/2015. */@Entity@Table(name = "user")public class User implements Serializable {    @Id    @GeneratedValue    private Long userId;    private String username;    private String password;    private String organisation;    public User() {    }    public Long getUserId() {        return userId;    }    public void setUserId(Long userId) {        this.userId = userId;    }    public String getUsername() {        return username;    }    public void setUsername(String username) {        this.username = username;    }    public String getPassword() {        return password;    }    public void setPassword(String password) {        this.password = password;    }    public String getOrganisation() {        return organisation;    }    public void setOrganisation(String organisation) {        this.organisation = organisation;    }}